// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BNBContract {
    // Mapping to keep track of balances
    mapping(address => uint256) public balances;

    // Event to log deposit events
    event Deposit(address indexed _from, uint256 _value);

    // Constructor to initialize the contract
    constructor() {
        // Initialize contract with 0 BNB balance
        balances[address(this)] = 0;
    }

    // Function to deposit 1 BNB to the contract
    function deposit() external payable {
        // Ensure the caller is depositing exactly 1 BNB
        require(msg.value == 1 ether, "Please deposit exactly 1 BNB");

        // Increase the contract balance
        balances[address(this)] += msg.value;

        // Emit deposit event
        emit Deposit(msg.sender, msg.value);
    }
}

